            <div class="col-md-8">
              <h3 class="fw-bold h4">เริ่ม 1 มี.ค. สธ.ปลด “โรคโควิด-19” ออกจากป่วยฉุกเฉิน ติดเชื้อรักษาตามสิทธิ</h3>
              <h4 class="fw-bold h6 mb-3 small text-secondary">10 ก.พ. 2565</h4>
              <p>สธ.เตรียมปลด “โรคโควิด-19” ออกจากป่วยฉุกเฉินรักษาได้ทุกที่ ติดเชื้อรักษาได้ตามสิทธิ พร้อมปรับอัตรารัฐจ่ายชดเชยค่าตรวจหาเชื้อ - ฮอสพิเทลลดลง เริ่ม 1 มี.ค.นี้ เผยยอดผู้ป่วยหนัก - เสียชีวิตโควิด-19 ต่ำกว่าเดิม 10 เท่า ก่อนอายุ 60 ปี อัตราเสียชีวิตต่ำกว่า 0.1%</p>
