            </div>
            <div class="col-md-8">
              <h3 class="fw-bold h4">ผู้ประกันตน ม.33 ฉีดวัคซีนโควิด-19 ทุกเข็มแล้วกว่า 3.7 ล้านโดส</h3>
              <h4 class="fw-bold h6 mb-3 small text-secondary">11 ก.พ. 2565</h4>
              <p>วันนี้ (11 กุมภาพันธ์ 2565) นายสุชาติ ชมกลิ่น รัฐมนตรีว่าการกระทรวงแรงงาน เปิดเผยว่า กระทรวงแรงงาน โดยสำนักงานประกันสังคม (สปส.) ขณะนี้ได้เร่งฉีดวัคซีนโควิด-19 ให้กับผู้ประกันตนมาตรา 33 ไปแล้วกว่า 3.7 ล้านโดส เพื่อสร้างภูมิคุ้มกัน ลดการแพร่ระบาด และลดความรุนแรงของโรคให้กับผู้ประกันตน</p>
              <a href="https://www.matichon.co.th/local/quality-life/news_3179070"><button type="button" class="btn btn-outline-secondary btn-sm">Read More</button></a>
