            </div>
            <div class="col-md-8">
              <h3 class="fw-bold h4">รวมสูตรฉีดวัคซีนโควิด สำหรับเด็กอายุ 5-17 ปี ฉบับล่าสุด</h3>
              <h4 class="fw-bold h6 mb-3 small text-secondary">11 ก.พ. 2565</h4>
              <p>เมื่อวันที่ 11 กุมภาพันธ์ 2565 ที่ทำเนียบรัฐบาล นพ.ทวีศิลป์ วิษณุโยธิน โฆษกศูนย์บริหารสถานการณ์โควิด 19 หรือ ศบค. เปิดเผยว่าที่ประชุม ศบค. เห็นชอบแนวทางการฉีดวัคซีนโควิด 19 สำหรับเด็กอายุ 5 ปีขึ้นไป - 17 ปี ของกระทรวงสาธารณสุข สำหรับการฉีดวัคซีนเข็ม 1 และ 2 ภายใต้คำแนะนำของคณะอนุกรรมการเสริมสร้างภูมิคุ้มกันโรค รวมกับผลการศึกษาประสิทธิผลการใช้วัคซีนที่ให้บริการจริงในประเทศ ร่วมกับเงื่อนไขการบริหารจัดการวัคซีนให้มีประสิทธิภาพสูงสุด และการได้รับการขึ้นทะเบียนกับ อย.</p>
